import uuid
from datetime import datetime
from enum import Enum
from typing import List, Dict, Optional, Any

class SubmissionStatus(Enum):
    DRAFT = "Draft"
    VALIDATING = "Validating"
    VALID = "Valid"
    INVALID = "Invalid"
    PUBLISHED = "Published"
    ERROR = "Error"

class IssueSeverity(Enum):
    LOW = "Low"
    MEDIUM = "Medium"
    HIGH = "High"
    CRITICAL = "Critical"

class FlexField:
    def __init__(self, name: str, value: Any, data_type: str):
        self.name = name
        self.value = value
        self.data_type = data_type

class Submission:
    def __init__(self, user_id: str):
        self.submission_id = str(uuid.uuid4())
        self.user_id = user_id
        self.status = SubmissionStatus.DRAFT
        self.created_at = datetime.now()
        self.updated_at = datetime.now()
        self.validation_errors = []
        self.flex_fields = []

    def update_status(self, new_status: SubmissionStatus):
        self.status = new_status
        self.updated_at = datetime.now()

    def add_validation_error(self, error_message: str):
        self.validation_errors.append(error_message)

    def clear_validation_errors(self):
        self.validation_errors = []

    def add_flex_field(self, name: str, value: Any, data_type: str):
        self.flex_fields.append(FlexField(name, value, data_type))

    def get_flex_field(self, name: str) -> Optional[FlexField]:
        for field in self.flex_fields:
            if field.name == name:
                return field
        return None

