class ValidationManager:
    def __init__(self):
        self.validation_rules = {
            "PPoP": r'^\d{5}$',
            "DUNS": r'^\d{9}$',
            "FEDERAL_ACTION_OBLIGATION": r'^\d+\.\d{2}$'
        }

    def validate_ppop_code(self, ppop_code: str) -> bool:
        import re
        return bool(re.match(self.validation_rules["PPoP"], ppop_code))

    def validate_duns_number(self, duns: str) -> bool:
        import re
        return bool(re.match(self.validation_rules["DUNS"], duns))

    def validate_federal_action_obligation(self, amount: str) -> bool:
        import re
        return bool(re.match(self.validation_rules["FEDERAL_ACTION_OBLIGATION"], amount))

    def update_validation_rule(self, rule_name: str, pattern: str) -> bool:
        if rule_name in self.validation_rules:
            self.validation_rules[rule_name] = pattern
            return True
        return False

