class FlexFieldManager:
    def __init__(self):
        self.flex_fields_db = {}

    def add_flex_field(self, entity_id: str, name: str, value: Any, data_type: str) -> bool:
        if entity_id not in self.flex_fields_db:
            self.flex_fields_db[entity_id] = []
        self.flex_fields_db[entity_id].append(FlexField(name, value, data_type))
        return True

    def retrieve_flex_fields(self, entity_id: str) -> List[FlexField]:
        return self.flex_fields_db.get(entity_id, [])

